import React from 'react'
import Card from "./Card"
import image1 from "../assets/nyork.jpg"
import image2 from "../assets/nighthawks.jpg"
import image3 from "../assets/sunset.jpg"

const cards = [
    {
        id : 1,
        title: 'Estudios',
        image: image1
    },
    {
        id : 2,
        title: 'Habilidades',
        image: image2
    },
    {
        id : 3,
        title: 'Experiencia',
        image: image3
    },
]

function Cards() {
  return (
    <div className='container d-flex justify-content-center align-items-center h-100'>
        <div className='row'>
            <div className='col-md-4'>
                <Card/>
            </div>
            
        </div>
        
    </div>
  )
}

export default Cards
